import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';
import BeerList from "./component/beer_list";

ReactDOM.render(
    <BeerList  beers={"coorna"}/>,
  document.getElementById('root')
);

